            "def": " Mistura de farinha com um líquido, formando pasta: massa de centeio. Aquillo que tem fórma ou semelhança de farinha empastada. Substância molle ou simplesmente pulverizada: massa de tomates. O todo, cujas partes são da mesma natureza. Conjunto das partes que constituem um todo. Totalidade: a massa da população. Um corpo compacto: caiu, como massa inerte. Multidão de povo. Matéria que constitue um corpo. O conjunto de fórças militares, congregadas como um todo. Substância informe. Pecúlio, formado por deducções no salário do soldado, para vestuário o outras despesas. "
